window.bookSummaryJSON = "<p>Being an undead princess comes with baggage. And unfortunately, it’s not Prada.</p> <p>Getting shredded in the <i>Daily Fang</i>, <i>The Bloody Times</i>, and <i>The National Dhampir</i> is par for the course in the life of a royal Vampyre - especially mine. However, that’s nothing compared to the shitshow unfolding in my life. </p> <p>My nightmares are coming true. </p> <p>Satan is throwing fits about changing diapers.</p> <p>The Baby Demons are full of cryptic messages. </p> <p>Martha and Jane have a sphincter obsession. </p> <p>There’s a half-naked Demon in my closet with a mouth as foul as mine. </p> <p>On top of all that, we’re hosting Demon-hating royal houseguests.</p> <p>Oh, and did I mention the Vampyre-eating Zombies on the West Coast? </p> <p>With Ethan by my side, along with new friends and a few well-hidden enemies, it’s time to adjust my crown, put a few Vampyres in their place, and kick some Zombie butt. </p> <p>I’m dead.</p> <p>Life is still good.</p> <p>I have unconditional love. </p> <p>And on most days, when I’m not covered in Zombie guts, I’m wildly fashionable. </p> <p>Fashionably dead, that is, and loving it.</p>"; 
